import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Sidebar from './components/sindbar';

function Admin() {
  return (
    <Router>
      <div className="App">
        <Sidebar/>
      </div>
    </Router>
  );
}

export default App;
